import React from 'react';
import { Link } from 'react-router-dom';
import '../css/dustdata.css'

const DustData = () => {
    return (
        <div className="dust-container">
            <header className="dust-header">
                <h1>미세먼지 정보 확인 page</h1>
            </header>
            <main className="dust-content">
                <p>오늘의 미세먼지</p>
                <p>사용자 맞춤 분석</p>
            </main>
            <Link to="/">
                <button className="main-button">Home</button>
            </Link>
        </div>
    );
};


export default DustData;
